### User:
write a JavaScript program to generate and print out the ascii character and hexadecimal codes for 0 to 7f

### Response:


Here is your code:
```javascript
for (let i = 0; i <= 7F; i++) {
    console.log(`ASCII Code: ${i}`);
}
console.log('----------------------------');
for (let i = 0; i <= 7F; i++) {
    console.log(`Hexadecimal Code: 0x${i.toString(16)}`);
}
```
